//www.ncbi.nlm.nih.gov/pubmed/15078674","https://www.ncbi.nlm.nih.gov/pmc/articles/PMC4657234/","https://eandv.biomedcentral.com/articles/10.1186/s40662-015-0026-2","Currently the %s below do not take into consideration any medications the patient may be taking"],complex_transition:[{condition:{condition_type:"Attribute",attribute:"diabetic_eye_damage",operator:"==",value:0},distributions:[{distribution:.998,transition:"Neuropathy_Progression"},{distribution:.002,transition:"Set_Mild_Eye_Damage"}],remarks:["Prevalence of DR = ~40%, we assume an estimated lifespan of ~20 yrs after diagnosis",".2%/month  over 20 yrs, 1- (.998 ^ (12*20)) = .38 "]},{condition:{condition_type:"Attribute",attribute:"diabetic_eye_damage",operator:"==",value:1},distributions:[{distribution:.9915,transition:"Set_Mild_Eye_Damage"},{distribution:.0085,transition:"Set_Moderate_Eye_Damage"}],remarks:["Roughly 10% chance of DR progression per year == 0.85% chance per month","https://eandv.biomedcentral.com/articles/10.1186/s40662-015-0026-2 (Table 3)"]},{condition:{condition_type:"Attribute",attribute:"diabetic_eye_damage",operator:"==",value:2},distributions:[{distribution:.9975,transition:"Set_Moderate_Eye_Damage"},{distribution:.0025,transition:"Set_Severe_Eye_Damage"}],remarks:["Roughly 3% progression from NPDR to PDR per year == .25% per month","https://eandv.biomedcentral.com/articles/10.1186/s40662-015-0026-2 (Table 3 again)"]},{condition:{condition_type:"Attribute",attribute:"diabetic_eye_damage",operator:"==",value:3},transition:"Set_Severe_Eye_Damage"}]},Set_Mild_Eye_Damage:{type:"SetAttribute",attribute:"diabetic_eye_damage",value:1,direct_transition:"Mild_Eye_Damage_Symptom"},Mild_Eye_Damage_Symptom:{type:"Symptom",symptom:"Blurred Vision",range:{low:1,high:60},direct_transition:"Set_Retinopathy"},Set_Retinopathy:{type:"SetAttribute",attribute:"retinopathy",value:!0,direct_transition:"Neuropathy_Progression"},Set_Moderate_Eye_Damage:{type:"SetAttribute",attribute:"diabetic_eye_damage",value:2,direct_transition:"Moderate_Eye_Damage_Symptom"},Moderate_Eye_Damage_Symptom:{type:"Symptom",symptom:"Blurred Vision",range:{low:20,high:100},direct_transition:"Set_Nonproliferative_Retinopathy"},Set_Nonproliferative_Retinopathy:{type:"SetAttribute",attribute:"nonproliferative_retinopathy",value:!0,direct_transition:"Chance_of_Macular_Edema"},Set_Severe_Eye_Damage:{type:"SetAttribute",attribute:"diabetic_eye_damage",value:3,direct_transition:"Severe_Eye_Damage_Symptom"},Severe_Eye_Damage_Symptom:{type:"Symptom",symptom:"Blurred Vision",range:{low:50,high:100},direct_transition:"Set_Proliferative_Retinopathy"},Set_Proliferative_Retinopathy:{type:"SetAttribute",attribute:"proliferative_retinopathy",value:!0,direct_transition:"Chance_of_Macular_Edema"},Chance_of_Macular_Edema:{type:"Simple",remarks:["Incidence of DME is very low. Very rough estimate == ~1% per year.","only around 20% of patients will hit this state, so we scale up to about 5% per year among those patients","5% / yr = .4% / month","https://www.ncbi.nlm.nih.gov/pmc/articles/PMC4657234/table/Tab5/"],distributed_transition:[{distribution:.004,transition:"Set_Macular_Edema"},{distribution:.996,transition:"Chance_of_Blindness"}]},Set_Macular_Edema:{type:"SetAttribute",attribute:"macular_edema",value:!0,direct_transition:"Chance_of_Blindness"},Chance_of_Blindness:{type:"Simple",remarks:["estimated prevalence of blindness is ~1% in MA; among diabetics we estimate 3%","3% / 30 yrs = ~ 0.01 % / month","http://www.idf.org/sites/default/files/IDF%2520Toolkit_Backgrounder_FINAL.pdf"],distributed_transition:[{distribution:1e-4,transition:"Set_Blindness"},{distribution:.9999,transition:"Neuropathy_Progression"}]},Set_Blindness:{type:"SetAttribute",attribute:"blindness",value:!0,direct_transition:"Neuropathy_Progression"},Neuropathy_Progression:{type:"Simple",complex_transition:[{condition:{condition_type:"Attribute",attribute:"diabetic_nerve_damage",operator:"==",value:0},distributions:[{distribution:.9971,transition:"Loop_back_to_Start"},{distribution:.0029,transition:"Set_Mild_Nerve_Damage"}],remarks:["DPN affects as many as 1/2 of all patients with diabetes.","50% over 20 years == ~ 0.29% per month"]},{condition:{condition_type:"Attribute",attribute:"diabetic_nerve_damage",operator:"==",value:1},distributions:[{distribution:.997,transition:"Set_Mild_Nerve_Damage"},{distribution:.003,transition:"Set_Moderate_Nerve_Damage"}],remarks:["at/beyond this point I can't find any well-defined #s on progression of diabetic neuropathy","0.3% / month --\x3e 3.5% / yr --\x3e 66% over 30 yrs"]},{condition:{condition_type:"Attribute",attribute:"diabetic_nerve_damage",operator:"==",value:2},distributions:[{distribution:.997,transition:"Set_Moderate_Nerve_Damage"},{distribution:.003,transition:"Set_Severe_Nerve_Damage"}]},{condition:{condition_type:"Attribute",attribute:"diabetic_nerve_damage",operator:"==",value:3},transition:"Set_Severe_Nerve_Damage"}]},Set_Mild_Nerve_Damage:{type:"SetAttribute",attribute:"diabetic_nerve_damage",value:1,direct_transition:"Set_Neuropathy"},Set_Neuropathy:{type:"SetAttribute",attribute:"neuropathy",value:!0,direct_transition:"Mild_Nerve_Damage_Symptom"},Mild_Nerve_Damage_Symptom:{type:"Symptom",symptom:"Tingling in Hands and Feet",range:{low:1,high:80},direct_transition:"Loop_back_to_Start"},Set_Moderate_Nerve_Damage:{type:"SetAttribute",attribute:"diabetic_nerve_damage",value:2,direct_transition:"Moderate_Nerve_Damage_Symptom"},Moderate_Nerve_Damage_Symptom:{type:"Symptom",symptom:"Tingling in Hands and Feet",range:{low:20,high:100},direct_transition:"Loop_back_to_Start"},Set_Severe_Nerve_Damage:{type:"SetAttribute",attribute:"diabetic_nerve_damage",value:3,direct_transition:"Severe_Nerve_Damage_Symptom"},Severe_Nerve_Damage_Symptom:{type:"Symptom",symptom:"Tingling in Hands and Feet",range:{low:50,high:100},direct_transition:"Loop_back_to_Start"},Loop_back_to_Start:{type:"Simple",direct_transition:"Diabetes_Progression"}}},opioid_addiction:{name:"Opioid Addiction",remarks:["Opioid addiction currently affects about 0.7% of the American population, or about 2.2M people. ","Since the 1990's prescription rates for opioids have increased exponentially. Today, doctors write ","between 50 and 150 opioid prescriptions per 100 people. see: ","http://www.cdc.gov/drugoverdose/data/prescribing.html","Currently the injuries module prescribed opioids at a rate of 25 - 30 per 100 people, but that's ","over a whole lifetime. 0-2 prescriptions are written for opioids for each patient after 1990, ","or about 1 / 25 = 0.04 per year. This is small compared to the total opioid prescriptions written ","each year. This module therefore picks up most of the remaining prescriptions, then evaluates all ","addiction rates using a modified model adapted from Project SAMMI: ","http://projectsammi.github.io/","Prior to 1990 we don't model opioid addiction - prescription rates were far lower and the ","'opioid crisis' of today is seen as beginning in the 90's and 00's."],states:{Initial:{type:"Initial",direct_transition:"Guard"},Guard:{type:"Guard",remarks:["Data on specific ages is limited but generally below age 15 no source indicates a statistically ","significant % of opioid addiction."],allow:{condition_type:"And",conditions:[{condition_type:"Age",operator:">=",quantity:14,unit:"years"},{condition_type:"Date",operator:">=",year:1990}]},direct_transition:"General_Population"},General_Population:{type:"Delay",exact:{quantity:1,unit:"months"},remarks:["Project SAMMI originally used a 1-day timestep and modeled opioid addiction over the course of ","one year. Our model runs for much longer - several decades, and we use a 1 month timestep. ","I reduced the incidence of new prescriptions by a factor of 4, and reduced misuse by a factor of 10. ","We need to generate fewer prescriptions since the injuries module regularly prescribes opioids for ","some injuries."],complex_transition:[{condition:{condition_type:"Attribute",attribute:"opioid_pr